class Matrix(object):
    def __init__(self):
        self.MODULO = 10 ** 9 + 7
        self.L = 26
        self.matrix = [[0] * self.L for _ in range(self.L)]

    # override multiply
    def __mul__(self, other):
        res = Matrix()
        for x in range(self.L):
            for y in range(self.L):
                for z in range(self.L):
                    res.matrix[x][y] = (res.matrix[x][y] + self.matrix[x][z] * other.matrix[z][y]) % self.MODULO
        return res

    def __str__(self):
        return str(self.matrix)


class Solution(object):
    def lengthAfterTransformations(self, s, t, nums):
        """
        :type s: str
        :type t: int
        :type nums: List[int]
        :rtype: int
        """
        # pre-process
        MODULO = 10 ** 9 + 7
        L = 26

        # helper function
        # I - return an unit matrix
        def I():
            unit = Matrix()
            for x in range(L):
                unit.matrix[x][x] = 1
            return unit

        # matrix binary exponentiation
        def quickMultiply(m, x):
            res = I()
            current = m
            while x:
                if x & 1:
                    res *= current
                current *= current
                x >>= 1
            return res

        # process
        T = Matrix()
        for x in range(L):
            for y in range(1, nums[x] + 1):
                row = (x + y) % L
                T.matrix[row][x] = 1
        # print(T)

        Ts = quickMultiply(T, t)
        # print(Ts)

        f = [0] * L
        for ch in s:
            idx = ord(ch) - ord('a')
            f[idx] += 1

        # apply transformation
        ans = 0
        for x in range(L):
            for y in range(L):
                ans = (ans + Ts.matrix[x][y] * f[y]) % MODULO
        return ans


